import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
const GOOGLE_CLIENTID = "435896067635-qnnts982dckt09ne136a37mh0efb0ej5.apps.googleusercontent.com"


ReactDOM.render(
  <BrowserRouter>
    <GoogleOAuthProvider clientId={GOOGLE_CLIENTID}>
      <App />
    </GoogleOAuthProvider>
  </BrowserRouter>,
  document.getElementById('root')
);
